import styled from "styled-components";

export const HomeContent = styled.div({
  display: "flex",
  position: "relative",
  alignItems: "flex-start",
  justifyContent: "flex-end",
});

export const HomeBackGround = styled.img({
  height: "100vh",
  marginLeft: "-20rem",
  position: "absolute",
  left: 0,
});

export const DivContent = styled.div({
  width: "60%",
  color: "white",
  marginRight: "10px",
  marginTop: "10px",
});

export const Input = styled.input({
  width: "80%",
  minWidth: "250px",
  border: "1px solid #999999",
  borderRadius: "12px",
  background: "transparent",
  fontSize: "18px",
  padding: "10px",
  marginRight: "12px",
  color: "white",
});

export const ButaoDeBusca = styled.button({
  minWidth: "250px",
  border: "1px solid #999999",
  borderRadius: "12px",
  background: "#203338",
  fontSize: "18px",
  padding: "10px",
  marginRight: "12px",
  color: "white",
});

export const ProfileInfo = styled.div({
  color: "white",
  width: "100%",
  marginRight: "10px",
  marginTop: "10px",
  display: "flex",
});

export const ProfileImage = styled.img({
  width: "50px",
  height: "50px",
  padding: "10px",
  border: "1px solid white",
  borderRadius: "100px",
});

export const Perfil = styled.div({
  display: "flex",
  flexDirection: "column",
  marginBottom: "2px",
  marginLeft: "10px",
});
